  false,\n\t\"url\": null,\n\t\"notes\": \"Qualifying utility customers receive waivers
  and discounts on their utility bills. The City of Austin has one of the most generous
  Customer Assistance Programs in the nation. Utility bill discounts are a key component
  of the program. They are provided to customers already receiving benefits through
  a variety of federal, state, county or city assistance programs. In February 2014,
  the Austin City Council voted to expand the discount program to 45,000 customers
  a year.  Additionally, in 2015 the Austin City Council voted to no longer have a
  waitlist as well as include Veterans Affairs Supportive Housing (VASH) vouchers
  as a qualifier.nnCustomers who qualify for utility bill discounts are receiving
  an average of $792 per year per family, $248 of which comes from Austin Energy.
  Total utility bill savings for the recipients is over $18 million annually. Below
  is a summary of electric account savings only.\",\n\t\"license_title\": \"License
